import React from 'react';
import Navbar from '../components/Navbar';
import EmergencyButton from '../components/EmergencyButton';

function Home() {
  return (
    <div>
      <Navbar />
      <div className="flex flex-col items-center justify-center min-h-screen bg-gray-100 p-6">
        <h1 className="text-4xl font-bold text-red-600 mb-6">Stay Safe with Nirbhay</h1>
        <EmergencyButton />
        <p className="text-gray-700 mt-4">Press the button to send an alert to your emergency contacts.</p>
      </div>
    </div>
  );
}

export default Home;
